  [],\n\t\"revision_timestamp\": \"2016-07-27T22:46:55.392495\",\n\t\"name\": \"narrative-report-september-october-november-december-1962-lostwood-national-wildlife-refug\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lostwood National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1962. The report begins by summarizing the weather conditions, water conditions,
  food and cover, and wildfires during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, and
  raptors- is also covered. The Refuge development and maintenance section discusses
  physical developments. Resource management is outlined; topics include grazing and
  fur harvesting. A progress report on field investigations and applied research is
  also provided. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, hunting, violations, and safety. Items
  of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\": \"License
